import React, { Component } from 'react'
import { Grid } from '@material-ui/core'
import Nav from './Nav'

export class Main extends Component {

    state = {
        messages: []
    }

    render() {

        componentDidMount = () => {
            fetch('http://localhost:3000/api/v1/messages')
            .then((res) => res.json())
            .then((data) => {
                this.setState({
                    messages: data
                })
            })
        }

        return (
            <Grid container direction='column'>
                <Grid container item>
                    <Nav/>
                </Grid>
                <Grid container item>
                    <Grid item container xs={12}>
                        <Messages messages={this.state.messages}/>
                    </Grid>
                </Grid>
                {/* <Grid item container>
                    <Grid item container xs={12}>
                        <Messages messages={this.state.recipeApiData}/>
                    </Grid>
                </Grid> */}
            </Grid>
        )
    }
}

export default Main
